import { useNavigate } from "react-router-dom";
import Header from "../topView/components/Header";
import FeatureSection from "../topView/components/FeatureSection";
import FAQ from "../topView/components/FAQ";
import styles from "./topView.module.css"; // CSS モジュールを適用

const TopView = () => {
  const navigate = useNavigate(); // ページ遷移用

  return (
    <div>
      <Header />
      <main>
        <FeatureSection />
        <button onClick={() => navigate("/projects")} className="project-button">
          案件詳細を見る
        </button>
        <FAQ />
      </main>
    </div>
  );
};

export default TopView;
